import logo from './logo.svg';
import './App.css';
import { Link, Router} from 'react-router-dom';
import "./countries.js";

function App() {
  return (

    <Router>
    <div>
      <h1>Choose your game</h1>
      <ul>
        <li>
        <Link to="countries">Countries</Link>
        </li>
      </ul>
    </div>
    </Router>

  );
}

export default App;
